import{_ as a,c as n,o as t,aj as i}from"./chunks/framework.D26WZD1w.js";const u=JSON.parse('{"title":"⚙️ Other Clubs","description":"","frontmatter":{"comment":false},"headers":[],"relativePath":"en-us/associations/others.md","filePath":"en-us/associations/others.md","lastUpdated":1758612136000}'),o={name:"en-us/associations/others.md"};function s(r,e,l,d,c,h){return t(),n("div",null,e[0]||(e[0]=[i('<h1 id="⚙️-other-clubs" tabindex="-1">⚙️ Other Clubs <a class="header-anchor" href="#⚙️-other-clubs" aria-label="Permalink to &quot;⚙️ Other Clubs&quot;">​</a></h1><h2 id="career-development-association" tabindex="-1">Career Development Association <a class="header-anchor" href="#career-development-association" aria-label="Permalink to &quot;Career Development Association&quot;">​</a></h2><p>The Career Development Association (CDA), founded in 2007, has been awarded a five-star club twice and consistently maintains a four-star rating. CDA upholds the mission of &quot;serving students and enhancing employability.&quot; Over more than a decade, it has organized various career-related activities, providing students with firsthand experience of the professional environment. CDA also regularly assists the Student Career Development Office in hosting international graduate education exhibitions and maintains connections with outstanding alumni. Additionally, CDA organizes study abroad experience sharing sessions, offering UIC students better opportunities for future development.</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NU8lT4U8LboRN8Ltl-boRn2ozlYUNnjknm94L7VVnl-DolU0gihFp2hmCIa0MkyPM1h2MYybMlUiLzT2olM7oz-sMz-8MRUioRGDL4UsLznFozUDMmlYL4VFLz-ZoRNJv2bjo4OeosrXCih4CIy0qIbtpYyPLzlag47YozGJqdwnx&amp;tid=1150&amp;nid=1290&amp;e=.png" width="100" height="100"></p><h2 id="enactus-innovation-entrepreneurship-team" tabindex="-1">Enactus (Innovation &amp; Entrepreneurship Team) <a class="header-anchor" href="#enactus-innovation-entrepreneurship-team" aria-label="Permalink to &quot;Enactus (Innovation &amp; Entrepreneurship Team)&quot;">​</a></h2><p>Founded in 2008, Enactus is a platform for experiential learning and growth for young people. We are committed to promoting integrity, passion, innovation, and collaboration, carrying forward the mission and vision of the Enactus community. Through business innovation and practical projects, we pave the way for young talents’ entrepreneurial development and create a positive social impact. In 16 years, we have developed and managed over 20 signature projects, led our team to win dozens of awards, and earned countless honors.</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NM7CTYMl-iMRlDntmNYnNrfU4NPU4GjaMl7aol-ZnNr7Ul70gihFp2hmCIa0M1hfMkysLSyPnRCYn7VVM7r2MzfkU8lsM4CPLzUYn7rkUmMFU8MVoz6VnRfFLzW7U4UJv2bjo4OeosrXCih4CIy0qIbtpYyPLzlag47YozGJqdwnx&amp;tid=1150&amp;nid=1290&amp;e=.png" width="100" height="100"></p><h2 id="tedxbnbu" tabindex="-1">TEDxBNBU <a class="header-anchor" href="#tedxbnbu" aria-label="Permalink to &quot;TEDxBNBU&quot;">​</a></h2><p>How far is the distance between ideals and reality?</p><p>Join TEDxBNBU and find the answer you seek. As an independent project launched by TED in 2009, TEDxBNBU encourages TED fans worldwide to organize TED-related activities. Following TED’s principles, TEDxBNBU is dedicated to ensuring valuable ideas and creativity are no longer constrained by “external limitations.” Join a group of outstanding peers in talks, salons, and exhibitions to let ideas flow and creativity come to life!</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NUN7T4UNQRL87sMtzrfU4NiM77YMlUjZoz98Lm9iolLDM4N0gihFp2hmCIa0n1y8UYy4UYybM4Wfn7n7Mmf7M7-iU8-8L7-8MR9Zn7WRn7QFol-aM8Q2nmWFLzG8UN7Jv2bjo4OeosrXCih4CIy0qIbtpYyPLzlag47YozGJqdwnx&amp;tid=1150&amp;nid=1290&amp;e=.png" width="100" height="100"></p><h2 id="wall-free-club-wfc" tabindex="-1">Wall Free Club (WFC) <a class="header-anchor" href="#wall-free-club-wfc" aria-label="Permalink to &quot;Wall Free Club (WFC)&quot;">​</a></h2><p>Wall Free Club (WFC), founded in 2012, was formerly BNBU’s only social enterprise club. Currently, we plan to restart the Wall Free Coffee Bar project on campus, using coffee sales for charity. Additionally, we organize traditional events such as GOGOG0 and Coffee Culture Festival, never stopping in our pursuit of innovation and creativity.</p><p>Join WFC, become a dreamer, and explore unlimited possibilities!</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NL8VT2LRLbM8W2ntmCbU4Uan7-PM7QjVoll8LmMVUzCYM8C0gihFp2hmCIa0MSyZUYhVn1yDLmvaoR-bMRUbMz9DL4rkMmW7U4n7LzWkLNQFMNWVo7UaL4VFLz7ZMRNJv2bjo4OeosrXCih4CIy0qIbtpYyPLzlag47YozGJqdwnx&amp;tid=1150&amp;nid=1290&amp;e=.png" width="100" height="100"></p><h2 id="food-culture-club" tabindex="-1">Food Culture Club <a class="header-anchor" href="#food-culture-club" aria-label="Permalink to &quot;Food Culture Club&quot;">​</a></h2><p>The Food Culture Club is dedicated to tasting, learning, and creating food. The club hosts high-flexibility food events such as Milk Tea Festival, Cake Festival, and Food Festival. Here, you can learn the culture behind each dish and also make and share food with other students. The club emphasizes both tasting and hands-on experience, teaching culinary skills while savoring food culture. Additionally, the club organizes occasional restaurant visits and posts recommendations on its official WeChat account to enrich campus life.</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NMmvTsUzLZUmWfLtzTVMzAfo7UPL7CjbLmWVUz-8nll4ozG0gihFp2hmCIa0n1yiM1hVoShVL4C8nmT7U8lYMNWRLR9PU4-ZozTfM7lPMNQFM4U4M4GanRnFLz-DnlCJv2bjo4OeosrXCih4CIy0qIbtpYyPLzlag47YozGJqdwnx&amp;tid=1150&amp;nid=1290&amp;e=.png" width="100" height="100"></p><h2 id="broadcasting-hosting-association" tabindex="-1">Broadcasting &amp; Hosting Association <a class="header-anchor" href="#broadcasting-hosting-association" aria-label="Permalink to &quot;Broadcasting &amp; Hosting Association&quot;">​</a></h2><p>The Broadcasting &amp; Hosting Association is a student club focused on broadcasting and hosting arts, providing a platform for students who love stage and voice to practice and showcase their talents. The association has three departments: Administration, Publicity, and Planning. It runs two main programs: a performance program, including stage dubbing performances, where members can demonstrate their voice acting skills; and a hosting program, providing hosting services for various campus and external events, enhancing members’ stage presence and communication skills.</p><p>Whether you are a beginner interested in broadcasting or an experienced performer seeking to improve, the Broadcasting &amp; Hosting Association is your ideal stage. Join us and become a voice ambassador and stage star!</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NL49TDLmAkUzTfMtz-anzMVUm-4o77jboR-DLz6VozNYLzl0gihFp2hmCIa0n1h2USyYLkyinlW2U8LPnzGYMzVVn7nVLzARUm-aoR94M4nFMR9iLRCZLzrFn7rRoSbaptveo4Oe6ITm5sMApYhXptQ0g47PMzG0Lz-bLkbw62w8c&amp;tid=1150&amp;nid=1290&amp;e=.png" width="100" height="100"></p>',22)]))}const m=a(o,[["render",s]]);export{u as __pageData,m as default};
